//获取随机题目
function random_data_str_arry(cartypeof){
	
	var temp_arry = [];
	var all_data_arry = JSON.parse(check_car_arry_datastr[cartypeof]);
	for(var i =0; i < 100; i++){
		var random_int = Math.floor(Math.random()*1000);
		var data_info = all_data_arry[random_int];
		temp_arry.push(data_info);

	};
	temp_random_data_str = JSON.stringify(temp_arry);
	console.log(temp_arry);
	return temp_random_data_str;

};


